        }
        header {
          position: fixed;
          height: 80px;
          width: 100%;
          line-height: 80px;
          background-color: ${colors.grey};
          font-size: 2rem;
          left: 0;
          top: 0;
          padding-left: 20px;
        }
      `}</style>
  </Layout>
  )
}

export default HomePage
